import styled from "styled-components";

function SectionAbout() {
  return (
    <Container>
      <Title>
        <h4>02</h4>
        <h2>Various ways for visual expression</h2>
        <h3>We always think about what could be the best way for visual expressions. We try to explore as many avenues as possible for better visual representation. </h3>
        <ViewBtn>
          <a href="./sub/drawing.php" class="s3ViewBtn">
            VIEW
          </a>
          <span></span>
        </ViewBtn>
      </Title>
      <Wrap>
        <SlideView>
          <ul class="s3Slide_wrap">
            <li class="s3Slide s3Slide0">
              <div></div>
            </li>
            <li class="s3Slide s3Slide1">
              <div></div>
            </li>
            <li class="s3Slide s3Slide2">
              <div></div>
            </li>
          </ul>
        </SlideView>
        <BtnWrap>
          <li>
            <a href="javascript:" class="s3PageBtn">
              01
            </a>
          </li>
          <li>
            <a href="javascript:" class="s3PageBtn">
              02
            </a>
          </li>
          <li>
            <a href="javascript:" class="s3PageBtn">
              03
            </a>
          </li>
        </BtnWrap>
      </Wrap>
      <BgWrap>
        <Bg></Bg>
      </BgWrap>
    </Container>
  );
}

export default SectionAbout;

const Container = styled.div`
  z-index: 1;
  position: relative;
  top: 0;
  left: 0;
  width: 100%;
  height: 1000px;
  background: #fff;
  margin-top: 130px;

  @media ${({ theme }) => theme.device.mobile} {
    height: 100%;
    margin-top: 80px;
  }
`;

const Title = styled.div`
  z-index: 2;
  position: relative;
  width: 100%;
  max-width: 74%;
  margin: 0 auto;
  padding-top: 100px;

  @media ${({ theme }) => theme.device.laptop} {
    z-index: 2;
    position: relative;
    width: 100%;
    max-width: 80%;
    margin: 0 auto;
    padding-top: 100px;
  }
  @media ${({ theme }) => theme.device.tablet} {
    padding-top: 50px;
    transition: all 0.3s;
  }
  @media ${({ theme }) => theme.device.mobile} {
    padding-top: 100px;
    transition: all 0.3s;
    text-align: center;
  }
  h4 {
    font-weight: 500;
    color: #000;
    font-size: 20px;
    @media ${({ theme }) => theme.device.laptop} {
      font-size: 18px;
    }
    @media ${({ theme }) => theme.device.tablet} {
      padding-top: 50px;
      transition: all 0.3s;
    }
    @media ${({ theme }) => theme.device.mobile} {
      padding-top: 100px;
      transition: all 0.3s;
      text-align: center;
    }
  }
  h2 {
    width: 40%;
    font-family: "Montserrat";
    font-weight: 600;
    color: #000;
    font-size: 60px;
    margin-top: 20px;
    line-height: 120%;
  }
  h3 {
    width: 30%;
    font-family: "Montserrat";
    font-weight: 500;
    color: #000;
    font-size: 18px;
    line-height: 160%;
    margin-top: 40px;
  }
`;

const Wrap = styled.div`
  z-index: 3;
  position: absolute;
  top: 250px;
  right: 13%;
  width: 44.981608%;
  height: 585px;
  background: seagreen;
  @media ${({ theme }) => theme.device.laptop} {
  }
`;

const SlideView = styled.div`
  position: relative;
  width: 100%;
  height: 100%;
  ul {
    position: relative;
    width: 100%;
    height: 100%;
    li {
      z-index: 1;
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      background: #112d4e;
      div {
        width: 100%;
        height: 100%;
        background: url(../img/drawing_1.jpg) no-repeat 50% 50%;
        background-size: cover;
      }
    }
  }
`;

const ViewBtn = styled.div`
  z-index: 3;
  position: absolute;
  bottom: -50px;
  left: 0;
  display: inline-block;
  width: auto;
  height: 25px;
  /* background: red; */
  margin-top: 40px;

  a {
    z-index: 2;
    position: relative;
    display: inline-block;
    width: 100%;
    height: 100%;
    font-family: "Montserrat";
    font-weight: 500;
    color: #000;
    font-size: 15px;
    transition: all 0.3s;
  }
`;

const BtnWrap = styled.ul`
  z-index: 2;
  position: absolute;
  bottom: 30px;
  left: -150px;
  li {
    display: inline-block;
    margin: 0 7px;
    a {
      font-family: "Montserrat";
      font-weight: 500;
      color: #b7b7b7;
      font-size: 15px;
    }
  }
`;

const BgWrap = styled.div`
  z-index: 1;
  position: absolute;
  top: 0;
  right: 0;
  width: 50%;
  height: 100%;
`;

const Bg = styled.div`
  z-index: 1;
  position: absolute;
  top: 0;
  right: 0;
  width: 100%;
  height: 100%;
  background: #f9f7f7;
`;
